import Header from "./components/header/Header";
import Layout from "./components/layout/Layout";
import notes from "./img/notes.svg";
import save from "./img/save.svg";
function App() {
  return (
    <div className="app">
      <Layout>
        <Header title="Notes" info={notes} save={save} exit="X"></Header>
      </Layout>
    </div>
  );
}

export default App;
